    photo: "/path/to/photo1.jpg",
    feedback:
      "Це був чудовий досвід роботи з [Ваше ім'я]. Вона/він надзвичайно професійна!",
  },
  {
    id: 2,
    name: "Ім'я 2",
    position: "Посада 2",
    photo: "/path/to/photo2.jpg",
    feedback: "[Ваше ім'я] завжди виконує свою роботу на найвищому рівні!",
  },
  {
    id: 3,
    name: "Ім'я 3",
    position: "Посада 3",
