    feedback:
      "Надзвичайно задоволений роботою з [Ваше ім'я]. Вона/він має неймовірні навички та підхід.",
  },
  {
    id: 4,
    name: "Ім'я 4",
    position: "Посада 4",
    photo: "/path/to/photo4.jpg",
    feedback:
      "Велике задоволення працювати з [Ваше ім'я]. Вона/він дуже відповідальна та професійна!",
  },
];

export default testimonialsData;
